import React, { Component } from 'react';
import {Link, withRouter} from 'react-router-dom';
import {Bar} from 'react-chartjs-2';

class MostAffected extends Component
{
    constructor(props) {
        super(props);
        this.state = {
            Data: {}
        }
    }

    componentDidMount() {
                let playername = ['San Francisco','San Jose','San Mateo','Milpitas','Fremont','Santa Clara'];
                let playerscore = [10,20,30,40,50,60];

                this.setState({
                    Data: {
                        labels: playername,
                        datasets:[
                            {
                                label:'Top 10 Affected Regions',
                                data: playerscore ,
                                backgroundColor:[
                                    'rgba(255,105,145,0.6)',
                                    'rgba(155,100,210,0.6)',
                                    'rgba(90,178,255,0.6)',
                                    'rgba(240,134,67,0.6)',
                                    'rgba(120,120,120,0.6)',
                                    'rgba(250,55,197,0.6)'
                                ]
                            }
                        ]
                    }
                });

    }
    render()
    {
        return(
            <div>

                <ul>
                    <li><Link to="/" className="active"  >Home</Link></li>
                    <li><Link to="/fire" >Fire-Events</Link></li>
                    <li><Link >Contact</Link></li>
                    <li className="heading">DISASTER MANAGEMENT PORTAL</li>
                </ul>
                <br />
                <h2 style={{ color: '#8424c9'}}><b>TOP 10 AFFECTED REGIONS</b></h2>
                <br />
                <Bar
                    data = {this.state.Data}
                    options = {{ maintainAspectRatio: false }} />
            </div>
        )
    }
}
export default withRouter(MostAffected)
